import React, { Component } from "react";
import './Menu.css'

export class Menu extends Component{
    
    render() {
        return (
        <div className="menu">
            <div className="blur"/>
            <div className="menu__content">
                <div className="menu__header"></div>
                <ul>
                    <li><a>{this.props.cont.w}</a></li>
                </ul>
            </div>
        </div>
        )    
    }
}

export default Menu
